 import axios from "axios";
 import { BASE_URL } from "../url";
 import React, { useState, useEffect } from 'react';
 import prop1 from "../assets/properties/1/1d4f0757fdb86d5f.jpg";
 import { Card , CardBody ,CardTitle , CardSubtitle ,CardText,CardFooter,Button,Container } from "reactstrap";


 const ShowCart = () =>{

    const [pglists,setpglists] = useState([]);
    const [propertylist, setPropertylist] = useState([]);
    const [facilities, setFacilities] = useState([]);

    const[reviews,setReviews] = useState([]);

    useEffect(() => {
       ShowCartProperties();
       //getcart()
      },[]);


    var id=sessionStorage.getItem("id");




      const getcart=()=>{
        axios.get(`${BASE_URL}/bookingCart/show_cart/${id}`).then(

        (response) =>{
        console.log(response.data);
        setpglists(response.data);
        console.log(pglists);
        }, 
        (error) =>{
          console.log(error);

        }
       ) ;
      }


      const ShowCartProperties = async () => {
        try {
          const response = await axios.get(`${BASE_URL}/bookingCart/show_cart/${id}`);
          console.log(response.data);
        //   console.log(response.data.properties)
        setPropertylist(response.data);
        var a=response.data;

        // a.forEach(element => {
        //     console.log("elemnt"+element.name);

        // });
        // console.log("aaaaaaa"+a);

        } catch (error) {
          console.error('Error fetching property details:', error);
        }
      };


    return(
           <div> 
     {propertylist.map(pglist => (

        <Card className="text-center">
            <CardBody>

                    <Container className="text-center"></Container>

                    <div class="property-card row">
            <div class="image-container col-md-4">
                <img src={prop1} />
            </div>
                <div class="detail-container">
                    <div class="property-name"> <CardSubtitle> {pglist.name} </CardSubtitle></div>
                    <div class="property-address"> <CardText>{pglist.description}</CardText></div>
                    <CardText>{pglist.address}</CardText>
                    <div class="property-gender">
                    <CardText>{pglist.gender}</CardText>
                    {/* {pglist.id} */}
                        {/* <img src="img/male.png" /> */}
                    </div>
                </div>
                <div class="row no-gutters">
                    <div class="rent-container col-6">
                        <div class="rent"><CardText>Rs{pglist.rent}/-</CardText></div>
                        <div class="rent-unit">per month</div>
                    </div>

                </div>
            </div>
        <br></br>
        <br></br>

            </CardBody> 
        </Card>
            ))} 
            </div>
    )
}
export default ShowCart;
